(190, 'Complete Backend Development with Nodejs', 'Javascript is being used for much more than it originally intended. All backend work may now be done through javascript. In this course , we will Â learn how to use current javascript to develop comprehensive backend code. To begin, we\'ll use VSCode to set up some tools. Then we\'ll learn how to build our own web server without using any third-party modules.Â After that, we\'ll learn express . We willÂ also learn how to send web-based and JSON-based responses. We\'ll go into body parser, middleware, and templating in more detail later.', '62d6e8baff20c4abd25d2b59.jpg', '', '', ''),
(191, 'Node JS Foundation', 'The entire course focuses on transforming you into a professional Node developer capable of creating, testing, and deploying real-world production apps. You\'ll be programming every project from the beginning and working through challenges that I\'ve made to reinforce what you\'ve learned. This will provide you with the practical experience you\'ll need to design and launch your project once you\'re finished.', '621cb673b0701c4ee5dbfc80.jpg', '', '', ''),
